import logo from './logo.svg';
import './App.css';
import { Button, Card } from 'react-bootstrap'
import 'bootstrap/dist/css/bootstrap.min.css'

function App() {
  return (
    <div className="container-fluid">
      <nav className="navbar navbar-expand-md navbar-dark bg-dark">


      <section className="collapse" id="navbarMainToggler">
        <div className="navbar-nav">
          <a className="nav-item nav-link" href="#">Home</a>
          <a className="nav-item nav-link" href="#">Channel</a>
          <a className="nav-item nav-link" href="#">Login</a>
        </div>  
      </section>

        <a className="navbar-brand" href="#">NAVI</a>

        <button className="navbar-toggler" type="button" data-toggler="collapse" data-target="#navbarMainToggler"
        aria-controls="navbarMainToggler" aria-expanded="false" aria-label="Toggle navigation"> 
        <span className="navbar-toggler-icon"></span>
        </button>     
      </nav>


    </div>
  );
}

export default App;
